@bretmanrock in @robertwun and @the.peterdo in @voguephilippines 

Including Peter and Robert’s designs in this shoot was a given. Not only were both of their brands apart of my first fitting with Bretman, but we have created some of our most memorable moments throughout the years with their pieces. Grateful to both of them for the constant support and of course, gorgeous looks. 🤍

